B.F4=new A.dR("Preguntas frecuentes","\xbfC\xf3mo funciona el proceso para agendar la fecha?\nEscr\xedbeme a hola@jpdirector.net para chequear si ese d\xeda  est\xe1 disponible, si es el caso,  puedes hacer un pago de dos partes 50% del precio de la conferencia y el otro 50% debe ser cancelado cinco d\xedas antes del evento.\n\n\xbfPuedes asistir a cualquier estado dentro de los Estados Unidos?\nClaro, solo debemos coordinar los boletos de avi\xf3n, hospedaje y vi\xe1ticos.",null)
